VS3XFHhQ">DOCS_modelChunk = {"chunk":[{"ty":"is","ibi":1,"s":"Hello!  My name is Rico.  I’m now 29.  I’m 6’0”, and I’m also autistic.  However, there’s more to me than meets the eye.  I currently live in the greater Green Bay, WI area.  (Go, Pack Go!)\n\nI’m heteroromantic and on the asexual spectrum.  Specifically, I’m cupiosexual (Someone who doesn’t experience sexual attraction but still desires a sexual relationship).  That said, I believe sex doesn’t make or break a relationship, and I would be open to dating someone who doesn’t want sex.  I’m also a Christian, and my faith is very important to me.  I would prefer to date someone who shares my faith, but it’s not required.\n\nI graduated from Northeast Wisconsin Technical College in 2017 from the Digital Media Technology program.  I am still searching for a job in my area, preferably in a video production type of role.  I’m a very creative person.  I run a few YouTube channels and a podcast, and I recently wrote a feature-length screenplay.  I’m a musician as well.  I write my own songs and recently started a music project with an internet friend.  I’m also very computer-savvy, having created a few Hackintoshes in the past.  I’m not really a coder or developer, but I wouldn’t mind learning one day.  I’m very much someone who likes to continue to learn new things.\n\nTopics of interest include:\nAutism/Neurodivergent Rights\nTheoretical physics\nLost media\nCopyright law (reform/abolition)\nAnything Disney\nMusic, especially:\nOwl City\nColdplay\nTwenty One Pilots\nImogen Heap\nTaylor Swift\nSophia Fracassi\nVictoria Duffield\nAnything Pop/Top 40\n(I’ll listen to nearly anything)\nTV Shows, especially:\nDoctor Who\nHouse of Anubis\nThomas the Tank Engine\nCastle\nGeneral Hospital\nGhostwriter (1992 PBS show and Apple TV+ Reboot)\nTheatre\nWriting\n\nMy love languages are quality time, words of affirmation, and physical touch.  In terms of what I look for in a partner, I’d like someone I can form a genuine connection with who can take me on their next adventure.  I would like to try to get out of my small bubble and see what else is out there.  I also wouldn’t mind working on a creative project together with my significant other.  My ideal partner currently doesn’t have kids, but I would be open to starting a family one day.  I’m monogamous and would prefer to date someone close to me, but I am open to long-distance relationships.\n\nI’m sorry if this is all over the place; I generally suck at bios.  If I sound interesting to you and you want to get in touch, please email me at ricojrobbins@gmail.com.  Remember that you don’t have to check every box I laid out.  I hope to hear from you soon!  I’ll leave you with a few pictures of me:\n* *\n*\n\n*\n^^  Me doing a show on my college radio station\n\n*\n^^ Me with a friend I did a YouTube reaction video series with\n\n*\n*\n^^ Me meeting two Internet friends from Orlando, FL\n*\n*\n^^ Me meeting pop artist Daya at a concert\n*\n*\n^^ Me at play rehearsal for 12 Angry Jurors\n*\n*\n^^ My Halloween costume from 2024… Ask me about the character it’s based on!"},{"ty":"as","st":"document","si":0,"ei":0,"sm":{"ds_lhs":1,"ds_ulhfl":false}},{"ty":"ae","et":"inline","id":"kix.19bl19x8zp6","epm":{"ee_eo":{"eo_bo":{"ln_s":0,"ln_w":0.0,"ln_c2":{"hclr_color":"#000000","clr_type":0}},"i_pid":null,"eo_mb":9.0,"i_ht":351.0,"eo_rtdf":{"rdf_ft":0},"eo_ml":9.0,"eo_mr":9.0,"eo_ad":null,"i_cid":"1A1FI2iht3O3PY4NYWpwJbybPd7fkQmwLkR8X0OFU","i_cont":0.0,"eo_mt":9.0,"eo_type":0,"eo_lco":{"lc_oi":"","lc_cs":"","lc_ct":0,"lc_sci":"","lc_srk":""},"i_wth":468.0,"eo_at":null,"i_iwc":{"iwc_w":false},"eo_hb":false,"eo_rtd":"","i_crop":{"crop_oxr":0.0,"crop_oyr":0.0,"crop_rot":0.0,"crop_hr":1.0,"crop_wr":1.0},"i_iw":false,"i_rot":0.0,"i_clst":{"cv":{"op":"set","opValue":[]}},"i_bri":0.0,"i_msct":0,"i_src":"","i_opa":1.0}}},{"ty":"ae","et":"inline","id":"kix.35p1k6iyplda","epm":{"ee_eo":{"eo_bo":{"ln_s":0,"ln_w":0.0,"ln_c2":{"hclr_color":"#000000","clr_type":
